import * as React from 'react';
import {
  Typography,
  Box,
  Card,
  CardContent,
  IconButton,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import ModeEditIcon from '@mui/icons-material/ModeEdit';
import Image from './image';
import TypographyLimited from './typography-limited';


const HouseCard = ({
  title,
  img,
  description,
  city,
  price,
  onDelete,
  onEdit,
}) => (
  <Card sx={{
    p: 2,
    display: 'flex',
    height: '270px',
    margin: '10px',
  }}
  >
    <Box sx={{ position: 'relative', width: '270px', height: '240px' }}>
      <Image
        src={img} 
      />
    </Box>
    <CardContent sx={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'space-between',
      width: '100%',
    }}
    >
      <Box sx={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
      }}
      >
        <Typography variant="h2" component="div">{title}</Typography>
        <Typography variant="h6" component="div">{`${price} €`}</Typography>
      </Box>
      <Typography mt={1}>{city}</Typography>
      <TypographyLimited mt={2}>{description}</TypographyLimited>
      <Box display="flex" justifyContent="flex-end">
        <Box display="flex" justifyContent="center" mt={4}>
          <IconButton
            sx={(theme) => ({ color: theme.palette.background })}
            size="large"
            onClick={onDelete}
          >
            <DeleteIcon />
          </IconButton>
        </Box>
        <Box display="flex" justifyContent="center" mt={4}>
          <IconButton
            sx={(theme) => ({ color: theme.palette.background })}
            size="large"
            onClick={onEdit}
          >
            <ModeEditIcon />
          </IconButton>
        </Box>
      </Box>
    </CardContent>
  </Card>
);

export default HouseCard;
